-- create and select the database
DROP DATABASE IF EXISTS easy_insure_db;
CREATE DATABASE easy_insure_db;
USE easy_insure_db;

-- create the tables
CREATE TABLE plan (
  planID    INT(11)       NOT NULL   AUTO_INCREMENT,
  planName  VARCHAR(255)  NOT NULL,
  base       INT(11) 		  NOT NULL,

  PRIMARY KEY (planID)
);

CREATE TABLE customer(
  customerID     	INT(11)       NOT NULL   AUTO_INCREMENT,
  planID       	  INT(11)       NOT NULL,
  firstName     	VARCHAR(255)  NOT NULL,
  lastName      	VARCHAR(255)  NOT NULL,
  age	       	    INT(11)       NOT NULL,
  gender       	  INT(1)	      NOT NULL,
  smoker		      INT(1)	      NOT NULL,
  val             INT(11)       NOT NULL,
  monthlyPremium	FLOAT(10)     NOT NULL,
  email           VARCHAR(255)  NOT NULL,
  phone           VARCHAR(255)  NOT NULL,
  policyStart     VARCHAR(255)  NOT NULL,
  address         VARCHAR(255)  NOT NULL,
  city            VARCHAR(255)  NOT NULL,
  state           VARCHAR(2)    NOT NULL,
  zip             INT(5)        NOT NULL,
  dependant       VARCHAR(255)  NOT NULL,
  contactN        VARCHAR(255)  NOT NULL,
  relation        VARCHAR(255)  NOT NULL,

  PRIMARY KEY (customerID),

  FOREIGN KEY (planID) REFERENCES plan(planID)
);

CREATE TABLE waitList(
  waitID        INT(11)         NOT NULL  AUTO_INCREMENT,
  firstName     VARCHAR(255)    NOT NULL,
  lastName      VARCHAR(255)    NOT NULL,
  phone         VARCHAR(255)    NOT NULL,
  email         VARCHAR(255)    NOT NULL,
  date          date            NOT NULL,
  time          time            NOT NULL,
  
  PRIMARY KEY (waitID)
);

